import React, {Component} from 'react';
import styled from  'styled-components';

class Join extends Component {
    render() {
        return(
            <JoinForm>
                <JoinText>회원가입</JoinText>
                <div>
                    <input type='text' className='id' placeholder='아이디'></input>
                </div>
                <div>
                    <input type='text' className='password' placeholder='비밀번호'></input>
                </div>
                <div>
                    <input type='text' className='email' placeholder='이메일'></input>
                </div>
                <JoinBtn type='button' className='joinbtn'>회원가입</JoinBtn>
            </JoinForm>
        )
    }
}

export default Join;

const JoinForm = styled.div`
   margin-top:180px;
` 

